window.bookSummaryJSON = "<p><b>Everyone wants a second chance. But at what cost?</b></p> <p>In the year 2045, an MRI mishap transmits Tabitha Moore's mind back into her body in the past.</p> <p>Now it's 1998. She's 13 years old, and she has to confront her long miserable lifetime of failures—and, once again, being trailer trash—all over again.</p> <p>Or does she?</p> <p><b>Experience the story of someone who's been given a chance to redo their entire life, starting at the last few days of middle school. This wholesome, heartfelt, and sometimes heart-wrenching do-over novel is sure to be your new obsession.</b></p> <p><b><i>Grab your copy today!</i></b></p>"; 
